import React from "react"
import { NavLink } from "react-router-dom"


function NavBar() {
    return (
        <div className="navigation">
            <nav className="navbar navbar-expand navbar-dark bg-dark">
                <div className="container">
                    <NavLink to="/" className="navbar-brand">
                        Journey Through Code
                    </NavLink>
                    <div>
                        <ul className="navbar-nav ml-auto">
                            <li className="nav-item">
                                <NavLink to="/" className="nav-item">Home<span className="sr-only">(current)</span></NavLink>
                            </li>
                            <li className="nav-item">
                                <NavLink to="/about" className="nav-item">About Me</NavLink>
                            </li>
                            <li className="nav-item">
                                <NavLink to="/blogs" className="nav-item">Blogs</NavLink>
                            </li>
                            <li className="nav-item">

                            </li>
                        </ul>
                    </div>
                </div>



                <NavLink to="/contact" className="col-1 m-1 ms-5 border-bottom border-light">Contact Me</NavLink>
            </nav>
        </div>
    )
}

export default NavBar;


